import "./footer.css";

const Footer: React.FC = () => {
  return (
    <div>
      <p id="p1">Double-click to edit a todo</p>
      <p id="p1">Created by Purnachandra Yadav PV</p>
      <p id="p1">Part of Opteamix</p>
    </div>
  );
};

export default Footer;
